import InputCost from '../components/InputCost';
import InputRevenue from '../components/InputRevenue';
import Button from '@material-ui/core/Button';



export default function InputPage() {
  return (
    <React.Fragment>
      <NavbarEmpty />
      {/* <StructureTwoColumns
